import React from 'react';

const loading = () => {
    return (
        <div class="loader loader--style2" title="1">
            <svg
                width="100%"
                height="100%"
                viewBox="0 0 32 32"
                xmlns="http://www.w3.org/2000/svg"
                xmlnsXlink="http://www.w3.org/1999/xlink"
            >
                <path d="some path here" fill="#000" />
            </svg>;
        </div>
    )
}

export default loading;
